import React from 'react';
const About=()=>{
    return(
   
        <div class="About">Technology is the sum of 
        techniques, skills, methods, and processes 
        used in the production of goods or services or 
        in the accomplishment of objectives, such as scientific 
        investigation. Technology can be the knowledge of techniques, processes, and the like, or it can be embedded in machines to allow for operation without detailed knowledge of their workings. Systems applying technology by taking an input, changing it according to the system's use, and then producing an outcome are referred to as technology systems or technological systems</div>
  
    );
}
export default About;
